import React from 'react'
import axios, { AxiosResponse } from 'axios'
import { TPosts } from '../../type/post'
import PostTemplate from '../template/post'

const PostsPage = () => {
    const [posts, setPosts] = React.useState<TPosts>([])
    React.useEffect(() => {
        axios.get("https://asia-northeast1-praha-test.cloudfunctions.net/getPosts")
        .then((result: AxiosResponse<TPosts>) => setPosts(result.data))
        .catch(err => console.log(err))
    }, [posts])

    return <PostTemplate posts={posts} />
}

export default PostsPage
